import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() { 
  const r = () => {
    return <p>`I love Kateryna`</p>
   }
  return (

    <div className="App">
      {r}
      <img src={logo} className="App-logo" alt="logo" />
    </div>

  );
}

export default App;
